import "./post-status-filter.css";

const PostStatusFilter = () => {
   return (
      <div className="btn-group">
         <button type="button" className="btn btn-info">
            Все
         </button>
         <button type="button" className="bnt btn-outline-secondary">
            Понравилось
         </button>
      </div>
   );
};

